bool
PhySimWifiVehicularChannelTest::CompareVectors (const itpp::cvec &input, const itpp::cvec &reference)
{
  if (input.size () != reference.size ())
    {
      return false;
    }
  uint32_t refSize = std::min (input.size (), reference.size ());
  for (uint32_t i = 0; i < refSize; ++i)
    {
      if (input(i) != reference (i))
        {
          std::complex<double> diff = RoundComplex (input (i)) - reference (i);
          if ( std::abs (diff.real ()) > 0.0001f || std::abs (diff.imag ()) > 0.0001f )
            {
              return false;
            }
        }
    }
  return true;
}

std::complex<double>
PhySimWifiVehicularChannelTest::RoundComplex (const std::complex<double> input)
{
  return std::complex<double> (RoundIEEE (input.real ()), RoundIEEE (input.imag ()));
}

double
PhySimWifiVehicularChannelTest::RoundIEEE (const double num)
{
  return itpp::round (num * 10000.0) / 10000.0;
}
